(function ($) {
  // Setting up vars and building controls
  var $list;
  var $listItem;
  var slidesCount;
  var itemWidth;
  var itemHeight;
  var listWidth;
  var currentSlide;
  var $nextButton;
  var $prevButton;
  var $listTitle;

  $list = $('.chapter-browser').find('.theme-wrapper');
  $listItem = $('.chapter-browser .theme');
  slidesCount = $listItem.length;
  itemWidth = $listItem.outerWidth();
  itemHeight = $listItem.outerHeight();
  listWidth = slidesCount * itemWidth;
  currentSlide = 0;

  $nextButton = $('<a />', {
    'id': 'next',
    'class': 'more',
    'href': '#',
    'text': 'Next'
  });

  $prevButton = $('<a />', {
    'id': 'prev',
    'class': 'back',
    'href': '#',
    'text': 'Prev'
  });

  $listTitle = $('<h3 />', {
    'class': 'chapter-list-title',
    'text': 'Explore Chapters'
  });

  // Function to move to specific slide passed in as an index via the parameter
  function gotoSlide (slide) {
    if ($list.filter(':not(:animated)').length) {
      var leftPosition = 0;
      var hasPrev = false;
      var hasNext = true;

      if ((slide > 0) && (slide < slidesCount)) {
        leftPosition = -(itemWidth * slide);
        hasPrev = true;
        if ((slide + 1) === slidesCount) {
          hasNext = false;
        } else {
          hasNext = true;
        }
      } else if (slide === 0) {
        leftPosition = 0;
        hasPrev = false;
        hasNext = true;
      } else {
        return false;
      }
      $('.chapters-list').fadeOut(0, function () {
        $list.animate({
          left: leftPosition
        }, 0, function () {
          currentSlide = slide;
          $('.browser-window').toggleClass('has-prev', hasPrev);
          $('.browser-window').toggleClass('has-next', hasNext);
          $('.chapters-list').fadeIn();
        });
      });
    }
    return false;
  }

  // Sets up carousel
  function setUp () {
    $list.css({'width': listWidth}).wrap('<div class="browser-window" />');
    $('.browser-window').prepend($listTitle);
    $('.browser-window').css({
      'height': itemHeight,
      'width': itemWidth,
      'overflow': 'hidden',
      'position': 'relative'
    }).addClass('has-next');

    $('.browser-window').prepend($prevButton);
    $('#prev').click(function () {
      gotoSlide(currentSlide - 1);
      return false;
    });

    $('.browser-window').prepend($nextButton);
    $('#next').click(function () {
      gotoSlide(currentSlide + 1);
      return false;
    });
  }

  setUp();
})(jQuery);

