        params["language"] = "en";
  
        // Submit Feedback with a POST
        xhr.open("POST", url);
        xhr.setRequestHeader("Content-Type", "application/json; charset=UTF-8;");
          xhr.onload = callback.bind(this);
          xhr.send(JSON.stringify({
          "submission": params
        }));
